script: |
  super -f text -I q3838.spq | sort > q3838.out

inputs:
  - name: q3838.spq
    data: |
      SELECT ALL col0 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + + col0 + 12 NOT IN ( + col2, col1 * + col1 + + - 42 + - col2, + col1, - col2, + - 65 );
  - name: tab0

outputs:
  - name: q3838.out
    data: |
